function(data) {
    try {
        var getTimeDifference = function(data) {
            var fullPublishDate = new Date(1000*data['published-date']),
                fullPublishDate = new Date(fullPublishDate.valueOf() + fullPublishDate.getTimezoneOffset() * 60000),
                articleMonth = fullPublishDate.getMonth(),
                articleDay = +fullPublishDate.toString().split(' ')[2],
                articleYear = fullPublishDate.getFullYear(),
                articleHour = fullPublishDate.getHours(),
                articleMinute = fullPublishDate.getMinutes(),
                fullCurrentDate = new Date(),
                fullCurrentDate = new Date(fullCurrentDate.valueOf() + fullCurrentDate.getTimezoneOffset() * 60000),
                currentMonth = fullCurrentDate.getMonth(),
                currentDay = +fullCurrentDate.toString().split(' ')[2],
                currentYear = fullCurrentDate.getFullYear(),
                currentHour = fullCurrentDate.getHours(),
                currentMinute = fullCurrentDate.getMinutes(),
                publisherID = TRC.publisherId,
                lastIndex = publisherID.split('-').length - 1,
                country = publisherID.split('-')[lastIndex],
                dayDiff,
                hourDiff,
                minDiff,
                monthDifference,
                previousMonthTotalDays,
                output,
                totalHourDiff;
            if (articleMinute >= 30 && articleHour < 23 && articleHour != currentHour) {
                articleHour++;
            }
            if (currentMonth == articleMonth){
                totalHourDiff = (24 - articleHour) + ((currentDay - articleDay - 1) * 24) + currentHour;
                minDiff = currentMinute - articleMinute;
                if (totalHourDiff < 24) {
                    switch(totalHourDiff) {
                        case 0:
                            output = minDiff + ' mins ago'
                            break;
                        case 1:
                            output = totalHourDiff + ' hour ago';
                            break;
                        default:
                            output = totalHourDiff + ' hours ago';
                    }
                    return output;
                } else {
                    dayDiff = currentDay - articleDay;
                    if (dayDiff !== 1) {
                        output = dayDiff + ' days ago';
                    } else {
                        output = 'Yesterday';
                    }
                    return output;
                }
            } else {
                previousMonthTotalDays = new Date(currentYear, articleMonth + 1, 0).toString().split(' ')[2];
                monthDifference = currentMonth - articleMonth;
                currentDay = currentDay + (previousMonthTotalDays*monthDifference);
                totalHourDiff = (24 - articleHour)+((currentDay-articleDay-1)*24) + currentHour;
                minDiff = currentMinute - articleMinute;
                if (totalHourDiff < 24) {
                    switch(totalHourDiff) {
                        case 0:
                            output = minDiff + ' mins ago'
                            break;
                        case 1:
                            output = totalHourDiff + ' hour ago';
                            break;
                        default:
                            output = totalHourDiff + ' hours ago';
                    }
                    return output;
                } else {
                    dayDiff = currentDay - articleDay;
                    if (dayDiff !== 1) {
                        output = dayDiff + ' days ago';
                    } else {
                        output = 'Yesterday';
                    }
                    return output;
                }
            }
        }
        data['uploader'] = getTimeDifference(data);
    } catch(error){
        __trcError(error);
    }
}
